import axios from 'axios';

function Example(){
    const [data,setData] = useState(null);
    const [isLoading,setIsLoading]=useState(true);
   
    useEffect(()=>{
    const getProducts = async function () {
        const res = await axios.get("http://localhost:3000/products");
        setData(res.data);
        setIsLoading(false);
    }
})
    getProducts()
    

}




